def composition(data_list, component):

    if component == data_list.shape[1]-1:
        origincomp = 1.0 - data_list[:, :-1].sum(axis=1)
        return origincomp

    else:
        return data_list[:, component]

def partition(emap, rows, cols):

    h, w = emap.shape

    return (emap.reshape(h // rows, rows, -1, cols)
            .swapaxes(1, 2)
            .reshape(-1, rows, cols))

