def array_reduce(values, get_delta=False):

    if isinstance(values, (list, tuple, numpy.ndarray)):
        if len(values) <= 2:
            raise ValueError('array_reduce() argument must have 3 or more elements.')
        else:
            vals_out = [values[0], values[-1]]
