def cumulative_returns(returns, return_type):

    if return_type == "log":
        cumulative_returns = returns.cumsum()
    elif return_type == "simp":
        cumulative_returns = (returns + 1).cumprod() - 1
    else:
        raise ValueError("Tipo de retorno invlido")

    return cumulative_returns

def is_disjoint(a, b):

