def human_to_bytes(size):

    sbytes = size[:-1]
    unit = size[-1]
    if sbytes.isdigit():
        sbytes = int(sbytes)
        if unit == "P":
            sbytes *= 1125899906842624
        elif unit == "T":
            sbytes *= 1099511627776
        elif unit == "G":
            sbytes *= 1073741824
        elif unit == "M":
            sbytes *= 1048576
        else:
            sbytes = 0
    else:
        sbytes = 0
    return sbytes

