	[x2, y2] = [loc2[0], loc2[1]]
	[x3, y3] = [loc3[0], loc3[1]]

	val = (x2 * y3 + x3 * y1 + x1 * y2) - (x2 * y1 + x3 * y2 + x1 * y3)

