def clamp(image, a, b):


    interval_len = b - a    
    return (interval_len / 255.0) * image + a

def Score(low, high, n):

    if n is None:
        return -1
    if low < n < high:
        return 1
    if n == low or n == high:
        return 0.5
    else:
        return 0

def col(loc, string):

    s = string
    return 1 if 0 < loc < len(s) and s[loc - 1] == "\n" else loc - s.rfind("\n", 0, loc)

def mass_kmv(kinetic_energy,velocity):

    result = (2*kinetic_energy)/velocity**2
    return result

