import datetime

class Source:
    @staticmethod
    def format_ISO_time(year: int, month: int, daytime: str) -> str:
        try:
            date = datetime.datetime(year, month, int(daytime[:2]), int(daytime[3:]))
            return date.isoformat()
        except Exception as e:
            raise e

def test_format_ISO_time():
