def map_features_to_dict(features, dataset, expert):


    if type(features) != dict:
        try:
            features = features.todict()
        except AttributeError:
            raise NotImplementedError(
                f"Type of cached features for {dataset.dataset_name}" + \
                "{expert.name} unknown")

    return features

